      console.log('Form submitted successfully', data);
      // Handle successful form submission, e.g., show a success message
    } catch (error) {
      console.error('Error submitting form', error);
      // Handle form submission error, e.g., show an error message
    }
  };

  const onChange = (event) => {
    setFormState({
      ...formState,
      [event.target.name]: event.target.value,
    });
  };

  return (
    <form onSubmit={onSubmit}>
      <label>
        Field 1:
        <input type="text" name="field1" value={formState.field1} onChange={onChange} />
      </label>
      <label>
        Field 2:
        <input type="text" name="field2" value={formState.field2} onChange={onChange} />
      </label>
      <label>
        Field 3:
        <input type="text" name="field3" value={formState.field3} onChange={onChange} />
      </label>
